import { Fragment } from "react";

import MainNavigation from "./MainNavigation";
import FooterComponent from "./FooterComponent";

const Layout = (props) => {
  return (
    <Fragment>
      <MainNavigation />
      <main>{props.children}</main>
      <FooterComponent />
    </Fragment>
  );
};

export default Layout;
